const webhookData = $('üåê Webhook: POST /verify-license').item.json;
const body = webhookData.body || {};
const query = webhookData.query || {};
const headers = webhookData.headers || {};

const licenseKey = body.license_key || query.license_key;
const clientIp = headers['x-real-ip'] || headers['x-forwarded-for']?.split(',')[0]?.trim() || 'unknown';

let domain = '';
let source = 'unknown';

const origin = headers['origin'] || '';
if (origin) {
  const match = origin.match(/^https?:\/\/([^/:]+)/);
  if (match) {
    domain = match[1];
    source = 'origin';
  }
}

if (!domain) {
  const referer = headers['referer'] || '';
  if (referer) {
    const match = referer.match(/^https?:\/\/([^/:]+)/);
    if (match) {
      domain = match[1];
      source = 'referer';
    }
  }
}

if (!domain) {
  domain = body.domain || query.domain || '';
  source = 'body';
}

